「なかったコトに!夜用ダイエットサプリ 30粒」は、ウコン、ショウガを配合した、夜型さんのダイエットをサポートするサプリメントです。夜食・間食をされる方、お酒のお付き合いが多い方、不規則な生活習慣などが気になる方をサポートします。<br><br>お召し上がり方 <br>1日2粒を目安に、おやすみ前に水またはぬるま湯でお召し上がりになることをおすすめします。<br><br>ご注意 <br>●薬を服用中あるいは通院中、妊娠中、授乳中の方は、お召し上がりになる前に、医師にご相談ください。<br>●乳幼児、小児の手の届かないところで保管ください。<br>●食物アレルギーのある方は、原材料名をご確認の上、お召し上がりください。<br>●体質・体調・飲み過ぎにより、まれにかゆみ、発疹、胃部不快感、下痢、便秘などの症状がでる場合があります。万一、体に異常を感じた場合は、ご使用を中止してください。<br>●過度なダイエットは危険です。バランスのとれた食事とともにご利用ください。<br>●本品は植物由来素材を使用しているため、色調に若干差が生じる場合がありますが、成分含有量や品質に問題はありません。<br>●品質保持のため、チャックをしっかり閉めて保管してください。ぬれた手で触るなどせず、衛生的にお取り扱い願います。<br>●開封後はなるべく早くお召し上がりください。<br>●乾燥剤が入っていますので、誤って召し上がらないようにご注意ください。<br><br>保存方法 <br>直射日光・高温多湿の場所を避けて保存してください。<br><br>原産国 日本<br><br>お問い合わせ先 <br>●販売者<br>株式会社グラフィコ<br>東京都品川区大崎1-6-1<br>TEL：0120-498-177<br><br>内容量：30粒(1粒：390mg)<br>1日量：2粒<br>約15日分<br>賞味期限の見方について：この商品の賞味期限は、「西暦年/月」の順番で表示されています。<br>名称・品名<br>ウコン・ショウガ抽出物含有食品<br>原材料<br>ウコン抽出物、澱粉、コーンシルク、キダチアロエ末、穀物発酵エキス、ショウガ、レモングラス、L-シトルリン、L-カルニチンフマル酸塩、クラチャイダム、クミスクチンエキス、有機マカ末、ブロッコリー、L-オルニチン塩酸塩、マルトデキストリン、しじみエキスパウダー、サラシアレティキュラータ、スーマエキス(パフィマ)、デキストリン、ショウガ抽出物(デキストリン・ヒハツエキス)、メリロートエキス末、炭酸Mg、西洋サンザシ抽出物、α-リポ酸、ゼラニウムディエルシアナム抽出物、ゼラチン、L-アルギニン、二酸化ケイ素、ステアリン酸Ca、レシチン(大豆由来)<br>栄養成分表示<br>2粒(780mg)あたり<br>エネルギー 2.86kcal、たんぱく質 0.36g、脂質 0.03g、炭水化物 0.29g、ナトリウム 1.01mg<br>4580159011417 17351 ＊なかったコトに！おやすみ前のバランスサプリ　　　<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
